import React from 'react'
 
function ListDisplay(props) {
    const items = props.items.map((item, i) => (
        <ListItem key={i} name={item} handleClick={props.handleClick}/>
    ))

    return (
    <ul>{items}</ul>
    )
}

export default ListDisplay;
